import React, {Component} from 'react';
import TweetsSingle from './TweetsSingle';

class Tweets extends Component {

    constructor(props) {
        super(props);
        this.state = {
            tweets: [],
        };
    }

    renderItems() {
        return this.props.items.map((item) => (
            <TweetsSingle key={item.id} item={item} />
        ));
    }

    render() {
        return(
            <ul>
                {this.renderItems()}
            </ul>
        );
    }
}

export default Tweets;
